 import React, { useState} from "react";
 
 function App(){
	 
	 const [num, setnum] = useState(0);
	 const Clicked = () =>{
		 
		 for(var i=0; i<5; i++){
		 
		 setnum(num + 1);
		 }
		 }
	 
	 
	 
	 
	 return(
	 <>
	 <h1>{num}</h1>
	 <button onClick={Clicked}>clicked</button>
	 
	 </>
	 )
	 
	 
 }
 export default App
